import Layout from "../components/Layout";

const Index = () => {
  return (
    <Layout>
      <div className="container" id="s" style={{ maxWidth: '100%', maxHeight:'5vh' }}>
        <h2 className="text-center">Home Page</h2>
      </div>
    </Layout>
  );
};

export default Index;
